            <ul className="navbar-nav">

                <li className="nav-item">
                    <Link to="/user/location" className="nav-link">
                        Resturant nearby
                </Link>
                </li>
                <li className="nav-item">
                    <Link to="/user/favorite" className="nav-link">
                        Favorite
                </Link>
